import React from "react";
import { useEffect, useState } from "react";
import { vendiaClient } from "./VendiaClient";

const { client } = vendiaClient();


export const DevicePage = () => {

    const[filteredTestList, setFilteredTestList] = useState();

    useEffect(() => {
        const filterTestList = async () => {
            const testList = await client.entities.test.list();
            //console.log(testList?.items);
            setFilteredTestList(testList?.filter(testList.includes("Device1")));
            


        }
        filterTestList();
    }, [])
    console.log(filteredTestList);

    return(
        
        <div className="DevicePage">
            <table>

                 <tr>
                    <th> TestID </th>
                    <th> OrgAssignment </th>
                    <th> TestName </th>
                    <th> TestMethod </th>
                    <th> Notes </th>
                    <th> Completed </th>
                    <th> UpdatedBy </th>
                </tr>   
                
                <tbody>

                </tbody>
            </table>

        </div>

    )
}
